you are a great man and you have great, true fans. we will never leave you alone, we love you and we support you. we will always help you and we really don't want you to be hurt. however, the majority depends on you. yes, i'm talking about lindsay usich. she hurts you and you know that most of us already know about it. i may be blocked, but nothing will change that we know what is going on and  messages about this whole situation will continue to spread. you will not change it. we are too worried to sit quietly.

lindsay hates us. she hates your friends. she treats you like her own. like an object. apparently she hated lily-white [*], the cat who was and is so important to you. but above all, she hurts you. if this that she punch you, threatens etc. is true, she is just a b*th. and you know it. brian, we're worried that she's just gonna kill you. if you are afraid #metoo, think of anything to prove her guilt. god, she's worse than amber heard. i thought the bigger b*tch could not exist. you are very intelligent. everything depends on you. do you still want to be in this world?
and sorry for my english. we love you so much brian, we are also your family. 
and i will delete comments of people who defend lindsay.
